import {scroll, banner1, banner2, banner3} from './assets/export'

function App() {
  return (
    <>
      <div className='banner-image_container'>
        {/* <div>
          <img src={banner1} alt="banner"  className='banner-image'/>
        </div> */}
        <CCarousel>
  <CCarouselItem>
    <CImage className="d-block w-100" src={ReactImg} alt="slide 1" />
  </CCarouselItem>
  <CCarouselItem>
    <CImage className="d-block w-100" src={VueImg} alt="slide 2" />
  </CCarouselItem>
  <CCarouselItem>
    <CImage className="d-block w-100" src={AngularImg} alt="slide 3" />
  </CCarouselItem>
</CCarousel>
      </div>

    </>
  );
}

export default App;
